import { Component } from "react";
import axios from "axios";
import "./Styles/styles.css";

class Main extends Component{

    constructor(){
        super()
        this.getAllContacts = this.getAllContacts.bind(this);
        this.state = {
            contacts: []
        }
    }

    getAllContacts(){
        axios.get('http://localhost:8080/contacts').then(response => {
            let elementsArr = [];
            response.data.forEach(contactObj, index => {
                elementsArr.push(
                    <div key = { index }>
                        {contactObj.name}
                    </div>
                );
            });
            this.setState({contacts: elementsArr})});
    }

    componentDidMount() {
        this.getAllContacts();
    }

    render(){
        return <div>
                { this.state.contacts }
            </div>
    }

}

export default Main;
